            <div>
                <h1>TASK2: Buttons</h1>
                <Button name={'YoutubeChanel-1'} callBack={()=>Button1('Alex', 22, 'Kiev')}/>
                <Button name={'YoutubeChanel-2'} callBack={()=>Button2('Serg')}/>
                {/*<button onClick={foo1}>1</button>*/}
                {/*<button onClick={()=>foo2(100200)}>2</button>*/}
            </div>

